Nubase Evaluation - Nubase2012
==============================
The Nubase2012 has been published by the Chinese Atomic Mass Data Center 
(http://amdc.impcas.ac.cn), see Chinese Physics C 36 (2012) 1157-1286.
NUBASE contains experimentaly known nuclear properties, and some that have 
been estimated from extrapolation, for 3827 nuclides: mass, isomeric excitation 
energy, half-life, spin, parity, decay modes and intensities.

